class transaction{
    constructor(infos) {
        this.id = (infos)?infos.id:"";
        this.date = (infos)?infos.nom:"";
        this.montant = (infos)?infos.prenom:"";
        this.type = (infos)?infos.ville:"";
        this.commentaire = (infos)?infos.tel:"";
        this.reservation = (infos)?infos.mail:"";
        this.client = (infos)?infos.solde:"";
        this.archive = (infos)?infos.archive:"";
    }
}

export default client;
